E em qualquer momento que o generator √© reiniciado com outra fun√ß√£o next(), qualquer que seja o valor enviado, ser√° o resultado dessa express√£o yield, que ent√£o ser√° adicionado 1, e atribu√≠do para a vari√°vel x. 

