Objetos Promessas
O objeto Promise √© usado para c√°lculos que s√£o adiados (demorados, retardados) e ass√≠ncronos.
Uma Promessa representa uma opera√ß√£o que ainda n√£o foi conclu√≠da, mas que est√° prevista para o futuro.
A cria√ß√£o de uma nova Promessa define-a automaticamente como estado pendente.
Estados de uma Promise
Internamente, uma promessa pode estar em um de tr√™s estados:

