Cumprida, quando e se o valor final se torna dispon√≠vel. Um valor de cumprimento se torna permanentemente associado √† promessa. Isso pode ser qualquer valor, incluindo undefined.
Rejeitado, se um erro impediu que o valor final fosse determinado. Isso pode ser qualquer valor, incluindo undefined, embora geralmente seja um objeto de Erro, como no tratamento de exce√ß√µes.

Criando Promessas
